import './GenericBanner.css';
import Banner from '../../resources/images/inner-banner.jpg'
import { useState } from 'react';

function GenericBanner(props){
    const [bannerText, setBannerText] = useState(props.bannerText)


    return (
        <>
            <div className='genericbanner'>
                <img src={Banner}/>
                <p>bannerText</p>
            </div>
        </>
    )
}
export default GenericBanner
